void getImage(uint8_t *imgId, char animation){

	int x,y,i;
	uint16_t color;
	uint16_t RGB565;
	uint8_t r, g, b;
	uint16_t *RGB565p; 
	x=y=0;
	
	if(*imgId>4){
		*imgId=1;
	}
	
	if(animation=='w')
		RGB565p = (uint16_t *)walk[*imgId-1];
	if(animation=='e')
		RGB565p = (uint16_t *)eating[*imgId-1];
	if(animation=='r')
		RGB565p = (uint16_t *)run[*imgId-1];
	if(animation=='c')
		RGB565p = (uint16_t *)cuddles[*imgId-1];	
	
	
	for(i=0 ; i<height*width ; i++){
		RGB565 = *RGB565p++;
		r = (RGB565 & 0xf800)>>8;
		g = (RGB565 & 0x07e0)>>3;
		b = (RGB565 & 0x001f)<<3;
		if(x==width){
			y++;
			x=0;
		}
 		color = (uint16_t)(((r>>3)<<11)|((g>>2)<<5)|(b>>3));
		if(color==0xFFFF){
			color = Grey;
		}
		LCD_SetPoint(x0+x, y0+y, color);
		x++;
	}
}

