void getVol(uint8_t imgId){
	int x,y,i;
	uint16_t color;
	uint16_t RGB565;
	uint8_t r, g, b;
	uint16_t *RGB565p; 
	x=y=0;
	
	if(imgId == 4)
		imgId = 3;
	RGB565p = (uint16_t *)imgvolume[imgId];

	for(i=0 ; i<21*21 ; i++){
		RGB565 = *RGB565p++;
		r = (RGB565 & 0xf800)>>8;
		g = (RGB565 & 0x07e0)>>3;
		b = (RGB565 & 0x001f)<<3;
		if(x==21){
			y++;
			x=0;
		}
 		color = (uint16_t)(((r>>3)<<11)|((g>>2)<<5)|(b>>3));
		if(color==0xFFFF){
			color = Grey;
		}
		LCD_SetPoint(10+x, 110+y, color);
		x++;
	}
}







